import React from 'react'
import { slots } from '../data'

const TimeSchedule = () => {
  return (
    <div className='Slot_container'>
      <h1 className='TS_heading'>Select a schedule</h1>
      <div className='TS_main_container'>
        {slots}
      </div>
    </div>
  )
}

export default TimeSchedule
